SET SQL_MODE="NO_AUTO_VALUE_ON_ZERO";
SET time_zone = "+00:00";

CREATE TABLE IF NOT EXISTS `departements` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `region` int(2) DEFAULT NULL,
  `dep` int(3) DEFAULT NULL,
  `cheflieu` varchar(5) DEFAULT NULL,
  `nom_dep` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


CREATE TABLE IF NOT EXISTS `regions` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `region` int(2) DEFAULT NULL,
  `prefecture` varchar(5) DEFAULT NULL,
  `nom_region` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


CREATE TABLE IF NOT EXISTS `villes` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `cp` int(5) DEFAULT NULL,
  `insee` varchar(5) DEFAULT NULL,
  `article` varchar(4) DEFAULT NULL,
  `ville` varchar(40) DEFAULT NULL, /* max is 35 */
  `libelle` varchar(40) DEFAULT NULL, /* max is 34 */
  `region` int(2) DEFAULT NULL,
  `dep` varchar(3) DEFAULT NULL,
  `lat` decimal(11,8) DEFAULT NULL,
  `long` decimal(11,8) DEFAULT NULL,
  `habitants30122008` int(7) DEFAULT NULL,
  `densite30122008` int(5) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

